import React from "react";
import "./index.css";

function Nav(){
    return(
        <>
            <div className="navbar">
                <h2>PROJECTION</h2>
                <ul>
                    <li>Home</li>
                    <li>Generic</li>
                    <li>Elements</li>
                </ul>
            </div>
        </>
    );
}
export default Nav;
